import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import axios from 'axios'
import { Table } from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css';


class App extends React.Component{

  constructor(props){
    super(props)
    this.state={
      items:[],
      flag:'hhhh'
    }
  }


async componentDidMount(){
  await axios.get('http://localhost:5000/')
  .then((response)=>{
    console.log(response.data.statewise)
    this.setState({items:response.data.statewise.slice(1,39),flag:'yyy'})})
  .catch((err)=>console.log(err))






  }


render(){

  return(
  <div >
      <Table dark>
      <thead>
        <tr>
          <th>STATES</th>
          <th>CONFIRMED</th>
          <th>ACTIVE</th>
          <th>RECOVERED</th>
          <th>DEATHS</th>

        </tr>
      </thead>

        {this.state.items.map(item=> <tr> 

            <td key={item.id}>{item.state}</td>

           </tr>)}



    </Table>


   </div>
    )}


}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);

